    mapboxApiAccessToken: 'sk.eyJ1IjoibG9yeXRpZiIsImEiOiJja2hlc2h1MWcwYjE4MnJsdTNsdTFlaTllIn0.y7YO6VRLvAPkNYlLm4BASA'
}


class Map extends React.Component{
    state = {
        viewport: {
          width: 400,
          height: 400,
          latitude: 37.7577,
          longitude: -122.4376,
          zoom: 8
        }
    };
    render() {
        return (
            <ReactMapGL
                    {...mapAccess}
                    onViewportChange={(newViewport) => this.setState({viewport: newViewport})}
                />
        );
      }
    }

export default Map;
